import React from "react";
import "./Navigation.css";

class Navigation extends React.Component {
  navigationItems = [];

  render() {
    return (
      <nav>
        <span>DLSU GDG</span>
        <img src="src\assets\images\DSC-logo.png" alt="DSC-Logo" />
      </nav>
    );
  }
}

export default Navigation;
